				case UserType.除籍生:
					return "OutStudent";
				case UserType.保護者:
					return "Parent";
				case UserType.他ユーザ:
					return "User";
				default:
					return missing;
			}
		}

		/// <summary>
		/// UserType英字略称
		/// </summary>
		/// <param name="self"></param>
		/// <param name="missing">存在しないenum値だった場合の返り値指定</param>
		/// <returns></returns>
		public static string AbbrevEn(this UserType self, string missing = null)
		{
			switch (self)
			{
				case UserType.職員:
					return "C";
				case UserType.教員:
					return "T";
				case UserType.在学生:
					return "S";
				case UserType.除籍生:
					return "O";
				case UserType.保護者:
					return "P";
				case UserType.他ユーザ:
					return "U";
				default:
					return missing;
			}
		}
		#endregion
	}
